import {
  Stack,
  Button
} from "@mui/material";
const Navbar = ()=>{
  const design = (
    <>
      <Stack>
        <Stack direction="row" justifyContent="space-between" sx={{
          backgroundColor:"secondary.light",
          color:"white"
        }}>
        <h1>Testing</h1>
          <Stack direction="row" justifyContent="center">
          <Button>Button-1</Button>
          <Button>Button-2</Button>
          </Stack>
        </Stack>
      </Stack>
    </>
  );
  return design;
}
export default Navbar;
